import {Route,Routes} from 'react-router-dom';
import Homepage from './Pages/Homepage';
//import ChatPage from './Pages/ChatPage';


function App() {
  return (
    <div className="App">
      <h2>hello</h2>
       <Routes>
        <Route path="/" component={Homepage} />
      </Routes>
    </div>
  );
}

export default App;
